import React, { Component } from "react";
import { Col, Container, Row } from "react-bootstrap";

class Nav extends Component {
  render() {
    return (
      <nav>
        <div className="mobileNav">
                <i class="lni lni-sthethoscope"></i>
                <i class="lni lni-16 lni-menu"></i>
        </div>
        <div className="desktopNav">
          <Row className="top">
            <Container>
              <Col lg={6}>
                <i class="lni lni-32 lni-sthethoscope"></i>
              </Col>
            </Container>
          </Row>
          <Row className="shadow bottom">
            <Container>
              <Col lg={6}></Col>
            </Container>
          </Row>
        </div>
      </nav>
    );
  }
}

export default Nav;
